import React, { useState } from "react";
import Whisper from "./Whisper";
import Llamabot from "./Llamabot";
import ImageCaptioning from "./ImageCaptioning";
import Generateimage from "./Generateimage";
import "./App.css";

function App() {
  const [selectedIntent, setSelectedIntent] = useState(null);

  const handleIntentChange = (intent) => {
    setSelectedIntent(intent);
  };

  return (
    <div className="app-container">
      <h1 className="title">CHOOSE DEFCON AI INTENTS</h1>

      <div className="button-container">
        <button 
          onClick={() => handleIntentChange('whisper')} 
          className="custom-button whisper"
        >
          Use Whisper (Transcribe Audio)
        </button>

        <button 
          onClick={() => handleIntentChange('llama')} 
          className="custom-button llama"
        >
          Use Llama (Chatbot)
        </button>

        <button 
          onClick={() => handleIntentChange('imageCaptioning')} 
          className="custom-button image-captioning"
        >
          Use Image Captioning
        </button>

        <button 
          onClick={() => handleIntentChange('imagegenerate')} 
          className="custom-button image-generate"
        >
          Use Text to Image
        </button>
      </div>

      {/* Render based on selected intent */}
      {selectedIntent === 'whisper' && <Whisper />}
      {selectedIntent === 'llama' && <Llamabot />} 
      {selectedIntent === 'imageCaptioning' && <ImageCaptioning />}
      {selectedIntent === 'imagegenerate' && <Generateimage />}
    </div>
  );
}

export default App;
